import React, { Component } from 'react';

import './App.css';

class App extends Component {
  constructor(props){
    super(props);
    this.state ={
      events: [],
      isLoaded: false
    }
  }

  componentDidMount(){
    fetch('')
  }

  render() {
    let {events, isLoaded} = this.state

    if(!isLoaded){
      return(
        <form> 
          <label>
            Your app_key 
            <input id="app_key" type="text" name="app_key" value=""/>
          </label>
          <label>
            Where 
            <input id="where"   type="text" name="where" value="San Diego"/>
          </label>
          <label>
            Query 
            <input id="query"   type="text" name="query" value="music"/>
          </label>
        </form> 
      ) 

    }else{
      return (
        <div className="App">
          Hello World
        </div>
      );
    }

  }
}

export default App;
